import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import MyTextEditor from './MyTextEditor';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <MyTextEditor/>
  </React.StrictMode>
);

